  false,\n\t\"url\": null,\n\t\"notes\": \"EX1206 was added and is now the final cruise
  of the 2012 season for Okeanos Explorer (EX). It will be primarily focused on further
  supplementing Northeast canyon and continental shelf mapping efforts carried out
  on EX cruises EX1106, EX1201, EX1204, and during 2011-2012 by NOAA ships Nancy Foster,
  Henry B. Bigelow, and Ferdinand R. Hassler. Multibeam and singlebeam survey, sub-bottom
  profiles, and CTD/XBT casts will be performed during the mission.\",\n\t\"owner_org\":
